  \"2014-07-15T21:12:13.080199\",\n\t\"name\": \"transformative-research-for-large-genome-physical-maps\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The main goal of the project is to construct
  and utilize high-resolution genome-wide RH-based physical maps of the wheat D-genome
  chromosomes to facilitate the construction of sequence-ready physical maps. This
  research provides an unprecedented view into the evolution of cereal genomes. Importantly,
  the methodology is being developed to be applied to other large and complex genomes
  such as polyploid wheat.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
